import React from 'react';
import './ActionButton.css';

function ActionButton(props) {
  return (
    <div className="ActionButton">
        <button>
            <h2>{props.title}</h2>
            <p>{props.subtitle}</p>
        </button>
    </div>
  );
}

export default ActionButton;
